<html>

<head>

    <style>
        body {
            margin: 0;
            padding: 0;
            background: #1a1a1a;
            color: #fff;
            font-family: sans-serif;
        }

        #map {
            position: absolute;
            top: 0;
            bottom: 0;
            width: 100%;
        }

        .info {
            padding: 6px 8px;
            font: 14px/16px Arial, Helvetica, sans-serif;
            background: rgba(0, 0, 0, 0.8);
            box-shadow: 0 0 15px rgba(0, 0, 0, 0.2);
            border-radius: 5px;
        }

        .info h4 {
            margin: 0 0 5px;
            color: #777;
        }

        .district-label {
            color: black;
            font-weight: bold;
            text-shadow:
                -1px -1px 0 #fff,
                1px -1px 0 #fff,
                -1px 1px 0 #fff,
                1px 1px 0 #fff;
        }

        .legend {
            line-height: 18px;
            color: #fff;
        }

        .legend i {
            width: 18px;
            height: 18px;
            float: left;
            margin-right: 8px;
            opacity: 0.7;
        }
    </style>
</head>

    <div id="map"></div>

    <script>
        var map = L.map('map').setView([37.8, -96], 4);

        L.tileLayer('https://cartodb-basemaps-{s}.global.ssl.fastly.net/dark_all/{z}/{x}/{y}.png', {
            maxZoom: 19,
            attribution: '&copy; <a href="http://www.openstreetmap.org/copyright">OpenStreetMap</a> &copy; <a href="http://cartodb.com/attributions">CartoDB</a>'
        }).addTo(map);

        // Primary MSAs for each district (Approximation for demo)
        const districtMSAs = {
            1: "Boston, MA",
            2: "New York, NY",
            3: "Philadelphia, PA",
            4: "Cleveland, OH",
            5: "Richmond, VA",
            6: "Atlanta, GA",
            7: "Chicago, IL",
            8: "St. Louis, MO",
            9: "Minneapolis, MN",
            10: "Kansas City, MO",
            11: "Dallas, TX",
            12: "San Francisco, CA"
        };

        const districtColors = {
            1: "#e6194b", // Boston - Red
            2: "#3cb44b", // New York - Green
            3: "#ffe119", // Philadelphia - Yellow
            4: "#4363d8", // Cleveland - Blue
            5: "#f58231", // Richmond - Orange
            6: "#911eb4", // Atlanta - Purple
            7: "#46f0f0", // Chicago - Cyan
            8: "#f032e6", // St. Louis - Magenta
            9: "#bcf60c", // Minneapolis - Lime
            10: "#fabebe", // Kansas City - Pink
            11: "#008080", // Dallas - Teal
            12: "#e6beff"  // San Francisco - Lavender
        };

        function style(feature) {
            const id = feature.properties.id; // Use properties.id (1-12)
            return {
                fillColor: districtColors[id] || '#ccc',
                weight: 1,
                opacity: 1,
                color: 'white',
                dashArray: '',
                fillOpacity: 0.2
            };
        }

        function highlightFeature(e) {
            var layer = e.target;
            layer.setStyle({
                weight: 5,
                color: '#666',
                dashArray: '',
                fillOpacity: 0.7
            });
            layer.bringToFront();
            info.update(layer.feature.properties);
        }

        function resetHighlight(e) {
            geojson.resetStyle(e.target);
            info.update();
        }

        function onEachFeature(feature, layer) {
            const id = feature.properties.id;
            const msa = districtMSAs[id] || "Unknown";
            feature.properties.msa = msa; // Inject properties for tooltip

            layer.on({
                mouseover: highlightFeature,
                mouseout: resetHighlight
            });

            // Add permanent label if possible or just tooltip
            layer.bindTooltip(`<strong>District ${id}</strong><br>Primary MSA: ${msa}`, {
                sticky: true,
                className: 'district-label'
            });
        }

        var info = L.control();

        info.onAdd = function (map) {
            this._div = L.DomUtil.create('div', 'info');
            this.update();
            return this._div;
        };

        info.update = function (props) {
            this._div.innerHTML = '<h4>Federal Reserve District</h4>' + (props ?
                '<b>District ' + props.id + '</b><br />' + districtMSAs[props.id]
                : 'Hover over a district');

                districts.features.forEach(feature => {
                    if (feature.geometry.type === 'MultiPolygon') {
                        feature.geometry.coordinates = feature.geometry.coordinates.filter(polygon => {
                            // Check first point of the first ring (outer ring)
                            const [lon, lat] = polygon[0][0];
                            // Contiguous US approximate bounds:
                            // Lat: 24 to 50
                            // Lon: -125 to -65
                            return lat > 24 && lat < 50 && lon > -125 && lon < -65;
                        });
                    }
                });

                geojson = L.geoJson(districts, {
                    style: style,
                    onEachFeature: onEachFeature
                }).addTo(map);

                    "Federal Reserve Districts": geojson
                };

                L.control.layers(null, overlayMaps, { collapsed: false }).addTo(map);
